    // final results = _mnCategory.saveAll('INSERT OR REPLACE INTO category (id,category,isDeleted)  VALUES (?,?,?)',categories);
    // return results; removed in sqfentity_gen 1.3.0+6
    await MyDbModel().batchStart();
