          [id, capital, id_money_provider, isDeleted]);
      if (result! > 0) {
        saveResult = BoolResult(
            success: true,
            successMessage: 'Transaction id=$id updated successfully');
      } else {
        saveResult = BoolResult(
            success: false, errorMessage: 'Transaction id=$id did not update');
      }
      return id;
    } catch (e) {
      saveResult = BoolResult(
